import { Component } from '@angular/core';
import { UsersService } from '../services/users.service';
@Component({
  selector: 'app-navbar',
  template: `
    <ul>
      <li><a >TechWorld</a></li>
      <li><a routerLinkActive="active" routerLink="home">Home</a></li>
      <li><a routerLinkActive="active" routerLink="catalog">Catalog</a></li>
      <li><a routerLinkActive="active" routerLink="about">About Us</a></li>
      <li><a routerLinkActive="active" routerLink="cart">Cart</a></li>
      <li *ngIf="!isLoggedIn; else logout"><a routerLinkActive="active" routerLink="profile">Login</a></li>
      <ng-template #logout><a (click)="logout()">Logout</a></ng-template>
    </ul>
  `,
})
export class NavbarComponent {
  isLoggedIn = false;

  logout() {
    this.isLoggedIn = false;
  }
}
